const Login = () => {
  return (
    <div>
      <fieldset
        style={{
          width: "60%",
          margin: "auto",
          marginBottom: "2%",
          textAlign: "end",
        }}
      >
        <legend>Login</legend>
        <form>
          <label>UserName</label>
          <input
            id="username"
            placeholder="UserName"
            className="fields"
            type="text"
          ></input>

          <label>Password</label>
          <input
            id="password"
            placeholder="Password"
            className="fields"
            type="password"
          ></input>
        </form>
      </fieldset>
    </div>
  );
};

export default Login;
